import React from "react";
import "./style.scss";
import PropTypes from "prop-types";

Navbar.propTypes = {};

function Navbar(props) {
  return (
    <div className="navbar">
      <h2 className="navbar__title">MIAGI</h2>
      <div className="navbar__logo"></div>
    </div>
  );
}

export default Navbar;
